@Assassinprofessor 

I did the update and then my previous games didn't work, including this one, so I googled and found out how to uninstall the update that came with the disc. I went to System/storage/clear cache, now all the games work and my dashboard is on 166.. something. And of course army of two the devlis c... is working too. If you do this then do it on your own risk. 

Im on liteon slim lt 2.0
